import './App.css';
import Header from './components/Header/Header';
import Menu from './components/Menu/Menu';
import Main from './components/Main/Main';

import Provider from './context/Provider';

function App() {
  return (

    <div className="App">
      <Provider>
        <Header />
        <Menu />
        <Main/>
      </Provider>
    </div>
  );
}

export default App;
